export default {
  title: 'Threat Prevention schema',
  type: 'object',
  properties: {
    enabled: { type: 'boolean' },
    passList: {
      type: 'array',
      items: {
        type: 'object',
        properties: {
          description: { type: 'string' },
          host: { type: 'string' },
        },
        required: ['description', 'host'],
        additionalProperties: false,
      },
    },
    redirect: { type: 'boolean' },
    sensitivity: { type: 'number' },
  },
  required: ['enabled', 'passList', 'redirect', 'sensitivity'],
  additionalProperties: false,
}
